import axios from 'axios';
import React, { useEffect, useState } from 'react'
import { userDetails } from '../../../store/user';
import { GET_USER_DETAILS } from '../../../env';
import { ProgressBar } from 'primereact/progressbar';
import { InputText } from 'primereact/inputtext';
import styled from 'styled-components';
import { motion } from 'framer-motion';

type Props = {}


const MyDetails = (props: Props) => {

    const [userData, setUserData] = useState<any>()

    useEffect(() => {
        if (userDetails.value.token) {
            axios.post(GET_USER_DETAILS, {
                "token": userDetails.value.token
            }).then((res) => {
                setUserData(res.data)
            }).catch((err) => {
                console.log(err);
            })

        }

    }, [])

    return (
        <div>
            {
                userData == undefined ?
                    <ProgressBar mode="indeterminate" style={{ height: '6px' }}></ProgressBar>
                    :
                    <UserDetails userData={userData} />

            }

        </div>
    )
}

export default MyDetails


const ContainerUserDetails = styled(motion.div)`
display: flex;
flex-wrap: wrap;
width: 100%;
padding: 5px;
margin: 0;
margin-top: 10px;
/* background-color: #f5f5f5; */
justify-content: center;
`;
const BoxFiled = styled(motion.div)`
width: 95%;
min-height: 100px;

`;
const BoxInside = styled(motion.div)`
border: 0.1px solid #bbbbbb;
border-radius: 10px;
padding: 10px;
font-weight: 500;

`;
const PBoxFiled = styled(motion.div)`

font-weight: 500;

`;




const UserDetails = (props: any) => {
    const [userData, setUserData] = useState<any>(props.userData)
    const [edit, setEdit] = useState<any>(true)



    return (
        <ContainerUserDetails>
            <BoxFiled>
                <label htmlFor="first_name">שם פרטי</label>
                <InputText id="first_name" aria-describedby="first_name-help" value={userData.first_name} style={{ width: '100%' }} />
                <small id="first_name-help">
                    מקסימום 20 תווים
                </small>
            </BoxFiled>
            <BoxFiled>
                <label htmlFor="last_name">שם משפחה</label>
                <InputText id="last_name" aria-describedby="last_name-help" value={userData.last_name} style={{ width: '100%', color: 'black' }} />
                <small id="last_name-help">
                    מקסימום 30 תווים
                </small>
            </BoxFiled>
            <BoxFiled>
                <label htmlFor="street">רחוב</label>
                <InputText id="street" aria-describedby="street-help" value={userData.street} style={{ width: '100%' }} />
                <small id="street-help">
                    מקסימום 30 תווים
                </small>
            </BoxFiled>
            <BoxFiled>
                <label htmlFor="city">עיר</label>
                <InputText id="city" aria-describedby="city-help" value={userData.city} style={{ width: '100%' }} />
                <small id="city-help">
                    מקסימום 20 תווים
                </small>
            </BoxFiled>
            <BoxFiled>
                <label htmlFor="email">אימייל</label>
                <InputText id="email" aria-describedby="email-help" value={userData.email} style={{ width: '100%', color: 'black', opacity: 80 }} disabled={edit} />
                {/* <small id="email-help">
                                   מקסימום 30 תווים
                                </small> */}
            </BoxFiled>
            <BoxFiled>
                <label htmlFor="phone">פלאפון</label>
                <InputText id="phone" aria-describedby="phone-help" value={userData.phone} style={{ width: '100%' }} />
                {/* <small id="phone-help">
                                   מקסימום 30 תווים
                                </small> */}
            </BoxFiled>
            <BoxFiled>
                <label htmlFor="phone2">פלאפון נוסף</label>
                <InputText id="phone2" aria-describedby="phone2-help" value={userData.phone2} style={{ width: '100%' }} />
                {/* <small id="phone2-help">
                                   מקסימום 30 תווים
                               </small> */}
            </BoxFiled>
        </ContainerUserDetails >

    )
}
